English:
@d5 This whole operation seems to have had totally different goals than the ones the teams were told. @w6 This should have been a short trip to Proxima Centauri to get more Pentaxid to help Earth survive. @w6 

But we ended up billions of light years beyond that point! @w4 In Andromeda! @p2 The fleet left the Jupiter orbit - forced by the Waverider Protocol as it seems. @w5 The irregular Vortex we were dragged into might be the reason for the passage to Andromeda. @w6 A wavefront, which pushed us further than the warp drives could ever have achieved alone. @w4 It seems like this was not an accident, but finely planned to the minute. @p6 I'm also not sure our little one-year delay was an accident either, @w5 ... planned as well, or a random side-effect? @p6 The fleet was attacked immediately upon arrival here ... 

@w5 which makes me think those Zirax were waiting for them @w4 for some reason.

Spanish:
@d5 Toda esta operación parece haber tenido objetivos totalmente diferentes a los que se les dijo a los equipos. @w6 Esto debería haber sido un viaje corto a Proxima Centauri para obtener más Pentaxid para ayudar a la Tierra a sobrevivir. @w6 

¡Pero terminamos miles de millones de años luz más allá de ese punto! @w4 En Andromeda! @p2 La flota abandonó la órbita de Júpiter, forzada por el Protocolo Waverider como parece. @w5 El vórtice irregular en el que fuimos arrastrados podría ser la razón del paso a Andrómeda. @w6 Un frente de onda, que nos empujó más allá de lo que las unidades de distorsión podrían haberse logrado solas. @w4 Parece que esto no fue un accidente, sino que se planeó con precisión al minuto. @p6 Tampoco estoy seguro de que nuestro pequeño retraso de un año haya sido un accidente, @w5 ... ¿también planeado o un efecto secundario aleatorio? @p6 La flota fue atacada inmediatamente a su llegada aquí ... 

 @w5, lo que me hace pensar que esos Zirax los estaban esperando @w4 por alguna razón.

Russian:
@d5 Похоже, что вся эта операция преследовала совершенно иные цели, чем те, о которых говорили командам. @w6 Это должно было быть короткое путешествие на Проксиму Центавра, чтобы получить больше пентаксида, чтобы помочь Земле выжить. @w6 

Но мы оказались на миллиарды световых лет дальше этой точки! @w4 В Андромеде! @p2 Флот покинул орбиту Юпитера - кажется, принужденый протоколом Waverider. @w5 Неправильный Вихрь, в котором мы оказались, мог быть причиной перехода к Андромеде. @w6 Волновой фронт, который подтолкнул нас дальше, чем варп-двигатели могли бы достичь в одиночку. @w4 Похоже, это не было случайностью, а было тщательно спланировано с точностью до минуты. @p6 Я также не уверен, что наша небольшая годичная задержка была случайностью, @w5 ... запланировано, или случайный побочный эффект? @p6 Флот был атакован сразу по прибытии сюда ... 

@w5 что заставляет меня думать, что эти Зиракс ждали их @w4 по какой-то причине.

English:
@d5 Dear Friend! @w2 We are happy to see you still alive ... @w2 but we have received more alarming info about the Legacy. @p6 Our Polaris allies told us they've lost one of their capital vessels - @w2 the Ilmarinen. @w6 

The vessel was exploring distant systems for the last few years. @w5 
Its goal was to find new worlds and new recources. @p5 The company lost contact with the ship about half a year ago. @w7 They've just told us they have new lead to track, @w5 but because of the Zirax patrols getting much more frequent in the months since your people's arrival, @w5 they are not able to officially investigate themselves. @p8 Now they are asking if you could lend them a hand.

Spanish:
@d5 Estimado amigo! @w2 Estamos felices de verte vivo ... @w2 pero hemos recibido más información alarmante sobre el Legacy. @p6 Nuestros aliados Polaris nos dijeron que habían perdido una de sus naves capitales: @w2 el Ilmarinen. @w6 

El buque estuvo explorando sistemas distantes durante los últimos años. @w5 
 Su objetivo era encontrar nuevos mundos y nuevos recursos. @p5 La compañía perdió contacto con el barco hace aproximadamente medio año. @w7 Nos acaban de decir que tienen una nueva pista para rastrear, @w5 pero debido a que las patrullas de Zirax se han vuelto mucho más frecuentes en los meses posteriores a la llegada de su gente, @w5 no pueden investigarse oficialmente. @p8 Ahora te preguntan si puedes echarles una mano.

