@d5 Дорогой друг! @w2 Мы рады видеть тебя живым ... @w2, но мы получили более тревожную информацию о Наследии. @p6 Наши союзники Полярис сообщили нам, что потеряли один из своих основных кораблей - @w2 Илмаринен. @w6 

Судно исследовало далекие системы последние несколько лет. @w5 
Его целью было найти новые миры и новые ресурсы. @p5 Компания потеряла связь с кораблем около полугода назад. @w7 Они только что сказали нам, что у них есть новая зацепка, @ w5, но из-за того, что патрули Зиракса стали намного более частыми в эти месяцы, прошедшие после прибытия ваших людей, @ w5 они не могут официально провести расследование. @p8 Теперь они спрашивают, не могли бы вы им помочь.

