最近几年，该船一直在探索遥远的星系。 @w5 
其目标是寻找新世界和新资源。 @p5 大约半年前，公司与这艘船失去联系。@w7 他们最近联系说找到了一个新的线索，@w5 但是由于兹瑞克斯巡逻队在你们地球人抵达后的几个月中出现的越来越频繁, @w5 所以北极星无法进行正式搜索。 @p8 现在他们希望你可以伸出援手。

English:
@d5 Ilmarinen Exploration Crew 
@w2 2nd Commander Fract'alite. @p3 THIS IS a WARNING to the pilot approaching this station! @p5 Hold your distance, pick up this message and relay it to the Polaris HQ! @p5 The Ilmarinen is heading for this planet, but it is not under our control! @w5 
To anyone who is reading this: @w2 Code Omega! @w3 DESTROY that whole ship! @p6 We picked something up, which killed the entire crew and has taken control of the ship. @w5 We managed to survive long enough to find this station and send this recorded warning, @w4 but no doubt we are already dead. @w4 Do not search for survivors. @p4 I repeat: @w4 DESTROY that ship and this station as well with the strongest weapons you have! @w5 Do NOT leave even dust! @p5 I am so sorry. @w2 Chief SaintJohn was absolutely right from the beginning. @w3 We might have revived the dark times. @w3 May the galaxy forgive us .. @w2

