 @w2 2º Comandante Fract'alite. @p3 ¡ESTA ES UNA ADVERTENCIA para el piloto que se acerca a esta estación! @p5 ¡Mantén la distancia, recoge este mensaje y transmítelo al Polaris HQ! @p5 ¡Ilmarinen se dirige a este planeta, pero no está bajo nuestro control! @w5 
Para cualquiera que esté leyendo esto: @w2 Codigo Omega! @w3 DESTRUYE toda esa nave! @p6 Recogimos algo, que mató a toda la tripulación y tomó el control de la nave. @w5 Logramos sobrevivir el tiempo suficiente para encontrar esta estación y enviar esta advertencia grabada, @w4, pero sin duda ya estamos muertos. @w4 No busque sobrevivientes. @p4 Repito: @w4 DESTRUYE esa nave y esta estación también con las armas más fuertes que tienes. @w5 ¡NO deje ni siquiera polvo! @p5 Lo siento mucho. @w2 El jefe SaintJohn tenía toda la razón desde el principio. @w3 Podríamos haber revivido los tiempos oscuros. @w3 Que la galaxia nos perdone .. @w2

